import { BrowserRouter, Route } from "react-router-dom"
import App from "./App"
import FormComponent from "./components/FormComponent"

const MyRoute = () =>{
    return(
        <BrowserRouter>
            <>
                <Route path="/" Component={App}/>
                <Route path="/create" exact Component={FormComponent}/>
            </>
        </BrowserRouter>
    )
}
export default MyRoute;
